<pre><code>const { MongoClient } = require('mongodb');
const config = {
    url: 'mongodb://localhost:27017',
    db: 'local',
    collection: 'startup_log'
}
MongoClient.connect(config.url, { useNewUrlParser: true }, (err, client) =&gt; {
    const db = client.db(config.db);
    const collection = db.collection(config.collection);
    const readable = collection.find({}, {fields: {'_id': 0, 'startTime': 1}});
    readable.on('readable', function() {
        let chunk;
        while (null !== (chunk = this.read())) {
          console.log(`Received ${chunk.length} bytes of data.`);
        }
        process.exit(0);
    });
});
</code></pre>

<p>Console output is "Received undefined bytes of data". This is because chunk is an object, but not BSON.</p>

<p>I'm using "mongodb" driver v3.1.1</p>

